            <img class="logo" src="images/redpin_logo.png">
            <div id="inputContainer">
            <!--<form action="register.php" method="POST" name="registrationForm" onsubmit=" return validateForm()"> -->
            <form action="php/register1.php" method="POST"
                  name="registrationForm" id="registerForm">
                <input id="regName" class="registerInputs" oninput="validateName()" name="uName" type="text" placeholder="First & Last Name" min="6" class="loginConfirm"required />
                <input id="regEmail" class="registerInputs" oninput="validateEmail()" name="uEmail" type="email" placeholder="Email" min="6" class="loginConfirm"required/>
                <input id="regUser" class="registerInputs" oninput="validateUser()" name="uUser" type="text" placeholder="Username" min="6" class="loginConfirm"required/>
                <input id="regPass" class="registerInputs" oninput="validatePassword()" name="uPass" type="password" placeholder="Password" min="4" class="loginConfirm" required/>
                <input id="regReEnter" class="registerInputs" name="rePass" type="password" placeholder="Re-Enter Password" oninput="validateForm()"  min="4" class="loginConfirm" required />

<!---------------------------- BUTTONS ------------------------------------>
                
            <input id="registerBut" type="submit" value="Submit" name="submitButton" style="width: 80%; font-size:15px;" onsubmit=""/>
            <button id="fbRegister">Register With Facebook</button>
            <input type="hidden" id="fbId" name="fbId"/>
            <input type="hidden" id="fbPic" name="fbPic"/>
