        <script src="js/redpin-register.js"></script>
        <script>
           var registerBut = document.getElementById("registerBut");
            var reEnterInput = document.getElementById("regReEnter");
            var passInput = document.getElementById("regPass");
            var regName = document.getElementById("regName");
            var regEmail = document.getElementById("regEmail");
            var userName = document.getElementById("regUser");
        
            function validateEmail(){
              var emailValue = regEmail.value;  
                if(emailValue.includes("@") && emailValue.includes(".com")){
                   regEmail.style.backgroundSize="15px";
                   }else{
                   regEmail.style.backgroundSize = "0px";
                        };
                   };

            function validateName(){
                var nameValue = regName.value;
                if(nameValue.length > 5){
                    regName.style.backgroundSize = "15px";
                }else{
                    regName.style.backgroundSize = "0px";
                };
            };
            
            
            function validateUser(){
                var value = userName.value;
                if(value.length > 5){
                   userName.style.backgroundSize = "15px";
                }else{
                    userName.style.backgroundSize = "0px";
                };
            };
            
            function validatePassword(){
                var value = passInput.value;
                if(value.length > 5){
                 passInput.style.backgroundSize = "15px";   
                }else{
                    passInput.style.backgroundSize = "0px";
                };
            };
            
            function validateForm(){
                if(passInput.value == reEnterInput.value){
                    
                    registerBut.style.transition = "1s";
                    registerBut.style.color = "#ed194e";
                    registerBut.style.backgroundColor = "#fff";
                    reEnterInput.style.backgroundSize="15px";
                }else{
                
                    registerBut.style.transition = "1s";
                    registerBut.style.color = "#fff";
                    registerBut.style.backgroundColor = "transparent";
                    reEnterInput.style.backgroundSize = "0px";
                };
            };
        </script>
        <script src="js/redpinFB.js"></script>
                <script src="js/onboard.js"></script>

    </body>
